Click op die link in my bio vir Kaartjies 🎫 

Soos julle weet , was ek n paar weke terug in Holland gewees . Ons het stroop waffels , rou vis en kaas geëet. Ek het my Hollandse ondersteuners ook daar ontmoet.  Jet is een van die talentvolle kunstenaars wat ek daar ontmoet het toe besluit ek omdat sy aanhangers in Suid Afrika het om haar saam met my op my toer te bring! Hierdie vertoning gaan wen vir die boeke wees!
@jet van der steen
